import React from "react";
import { Card, Title, Paragraph } from "react-native-paper";

interface props {
  item: singleItem;
}
export default function Item(props: props) {
  return (
    <Card key={props.item.uuid} style={{ height: 300, width: 400 }}>
      <Card.Content>
        <Title>{props.item.displayName}</Title>
        <Paragraph>{props.item.uuid}</Paragraph>
      </Card.Content>
      <Card.Cover source={{ uri: props.item.displayIcon }} />
    </Card>
  );
}
